import "./NoteItem.css";
function NoteItem(props) {
  let readableDate = props.dateCreated.toString();
  return (
    <li>
      <button>X</button>
      <div className="title">{props.title}</div>
      <div className="date">{readableDate}</div>
      <div className="note">{props.note}</div>
    </li>
  );
}

export default NoteItem;
